export default function Logo() {
  const logoStyle = {
    /* Heading/XXL */
    fontFamily: "Pretendard",
    fontSize: "10.6vw",
    fontWeight: "bold",
    lineHeight: "140%",
    textAlign: "center",
  };

  return (
    <>
      <div style={logoStyle}>NOAH</div>
    </>
  );
}
